__NUXT_JSONP__("/drugs/Gedatolisib", (function(a,b,c){return {data:[{drug:{slug:a,emaEpar:[],fdaDrugLabel:[],id:a,nciThesaurus:{casRegistry:"1197160-78-3",chebiId:b,chemicalFormula:b,definition:"An agent targeting the phosphatidylinositol 3 kinase (PI3K) and mammalian target of rapamycin (mTOR) in the PI3K\u002FmTOR signaling pathway, with potential antineoplastic activity. Upon intravenous administration, gedatolisib inhibits both PI3K and mTOR kinases, which may result in apoptosis and growth inhibition of cancer cells overexpressing PI3K\u002FmTOR. Activation of the PI3K\u002FmTOR pathway promotes cell growth, survival, and resistance to chemotherapy and radiotherapy; mTOR, a serine\u002Fthreonine kinase downstream of PI3K, may also be activated independent of PI3K.",fdaUniiCode:"96265TNH2R",identifier:"C91732",preferredName:a,semanticType:"Pharmacologic Substance",subclassOf:["C129825","C2152"],synonyms:["1-(4-[[4-(dimethylamino)piperidin-1-yl]carbonyl]phenyl)-3-[4-(4,6-dimorpholin-4-yl-1,3,5-triazin-2-yl)phenyl]urea","GEDATOLISIB",a,"PF 05212384","PF-05212384","PKI 587","PKI-587","Urea, N-(4-((4-(dimethylamino)-1-piperidinyl)carbonyl)phenyl)-N'-(4-(4,6-di-4-morpholinyl-1,3,5-triazin-2-yl)phenyl)-"]},dir:"\u002Fdrugs",path:"\u002Fdrugs\u002FGedatolisib",extension:".json",createdAt:c,updatedAt:c}}],fetch:{},mutations:void 0}}("Gedatolisib","","2021-10-30T13:47:32.983Z")));